import groovy.json.*
import groovy.util.*

// parse JSON content in the request
def jsonText = messageExchange.response.responseContent
def parsedJson = new JsonSlurper().parseText(jsonText)

// assert values in the response
def expectedNEOs = parsedJson.element_count
def neos = parsedJson.near_earth_objects

def actualNEOs = 0;
neos.each{
	key, value -> actualNEOs += neos[key].size()
