log.info actualNEOs

assert expectedNEOs == actualNEOs

import groovy.json.*
import groovy.util.*

// parse JSON content in the request
def jsonText = messageExchange.response.responseContent
def parsedJson = new JsonSlurper().parseText(jsonText)

// get dates from parameters and format to dates for comparison later
def ts = context.testCase.getTestStepByName('ValidateCloseApproachDate')
def datePattern = "yyyy-MM-dd"
def startDate = Date.parse(datePattern, ts.getPropertyValue('start_date'))
def endDate = Date.parse(datePattern, ts.getPropertyValue('end_date'))

// do each statement to get the individual keys(dates) within the near_earth_objects
// for each key, traverse the array of objects and assert if it's date is within specified dates
def neos = parsedJson.near_earth_objects
neos.each{ key, value -> 
	def currentDay = neos[key]
	for (object in currentDay) {
		def currentObjectDateString = object.close_approach_data[0].close_approach_date
		def currentObjectDate = Date.parse(datePattern, currentObjectDateString)
		log.info currentObjectDateString
		assert currentObjectDate >= startDate
		assert currentObjectDate <= endDate
	}
}

import groovy.json.*
import groovy.util.*

// parse JSON content in the request
def jsonText = messageExchange.response.responseContent
def parsedJson = new JsonSlurper().parseText(jsonText)

// do each statement to get the individual keys(dates) within the near_earth_objects
// for each key, traverse the array of objects and assert if the miss_distance (AU) is > 0.05 it shows false
def neos = parsedJson.near_earth_objects
neos.each{ key, value -> 
	def currentDay = neos[key]
	for (object in currentDay) {
		def currentObjectIsHazardous = object.is_potentially_hazardous_asteroid
		def currentObjectMissDistance = object.close_approach_data[0].miss_distance.astronomical as Float
		log.info currentObjectIsHazardous
		log.info currentObjectMissDistance
		if (currentObjectMissDistance > 0.05) {
			assert currentObjectIsHazardous == false
		}
	}
}

