con:restMockAction.con:dispatchPath:
// Match based on query parameter
def queryString = mockRequest.getRequest().getQueryString()
log.info "QueryString: " + queryString
if (!queryString.contains("api_key")) {
	return "Response 2"
}

// check date range and return Response 3 if date range > 7
def startDate = mockRequest.request.getParameter("start_date")
def endDate = mockRequest.request.getParameter("end_date")
log.info "start_date: " + startDate
log.info "end_date: " + endDate
log.info "length" + startDate.length()

def datePattern = "yyyy-MM-dd"
def startDateDate = Date.parse(datePattern, startDate)
def endDateDate = Date.parse(datePattern, endDate)
def duration = endDateDate - startDateDate
log.info "date difference: " + duration
if (duration > 7) {
	return "Response 3"
}

